    [],nt"revision_timestamp": "2016-02-27T14:10:42.729283",nt"name": "doq-usgs-digital-orthophoto-quadrangle-1975-2005",nt"isopen":
    false,nt"url": null,nt"notes": "Orthophotos combine the image characteristics
    of a photograph with the geometric qualities of a map. The primary digital orthophotoquadrangle
    (DOQ) is a 1-meter ground resolution, quarter-quadrangle (3.75 minutes of latitude
    by 3.75 minutes of longitude) image cast on the Universal Transverse Mercator projection
    (UTM) on the North American Datum of 1983 NAD83). The geographic extent of the DOQ
    is equivalent to a quarter-quadrangle plus the overage ranges from a minimum of
    50 meters to a maximum of 300 meters beyond the extremes of the primary and secondary
    corner points. The overage is included to facilitate tonal matching for mosaicking
    and for the placement of the NAD83 and secondary datum corner ticks. The normal
    orientation of data is by lines (rows) and samples (columns). Each line contains
    a series of pixels ordered from west to east with the order of the lines from north
    to south. The radiometric image brightness values are stored as 256 gray levels,
    ranging from 0 to 255. The standard, uncompressed gray scale DOQ format contains
    an ASCII header followed by a series of 8-bit image data lines. The keyword-based,
    ASCII header may vary in the number of data entries. The header is affixed to the
    beginning of the image and is composed of strings of 80 characters with an asterisk
    (*) as character 79 and an invisible newline character as character 80. Each keyword
    string contains information for either identification, display, or registration
    of the image. Additional strings of blanks are added to the header so that the length
    of a header line equals the number of bytes in a line of image data. The header
    line will be equal in length to the length of an image line. If the sum of the byte
    count of the header is less than the sample count of one DOQ image line, then the
    remainder of the header is padded with the requisite number of 80 character blank
    entries, each terminated with an asterisk and newline character.",nt"license_title":
